    if(i==0){
        return index;
    }
    byte[] bytes = new byte[4];
    bytes[3] = (byte)((i >> 24) & 0xFF);
    bytes[2] = (byte)((i >> 16) & 0xFF);
    bytes[1] = (byte)((i >> 8) & 0xFF);
    bytes[0] = (byte)(i & 0xFF);
    try{
        sb.append(new String(bytes, "UTF-8"));
    }catch(UnsupportedEncodingException e){
        e.printStackTrace();
    }
    return index+1;
}

