    if (path == null) {
        return pathSegments;
    }
    String[] segments = path.split("/");
    for (String segment : segments) {
        if (segment.isEmpty()) {
            continue;
        }
        if (decode) {
            segment = decodeURIComponent(segment);
        }
        pathSegments.add(new PathSegmentImpl(segment));
    }
    return pathSegments;
}

