private List<Pair<List<Pair<Integer,Integer>>,E>> computeGlobalSeparatorList(){
List<Pair<List<Pair<Integer,Integer>>,E>> result = new ArrayList<>();
    for(E edge: graph.edgeSet()){
        List<Pair<Integer,Integer>> separators = new ArrayList<>();
        for(E neighbor: graph.neighbors(edge)){
            if(!isCircle(neighbor, edge)){
                int a = graph.getNode(edge.getSource()).getIndex();
                int b = graph.getNode(edge.getTarget()).getIndex();
                int c = graph.getNode(neighbor.getSource()).getIndex();
                int d = graph.getNode(neighbor.getTarget()).getIndex();
                int separator = Math.abs(a - c) + Math.abs(b - d);
                separators.add(new Pair<>(a, separator));
                separators.add(new Pair<>(b, separator));
                separators.add(new Pair<>(c, separator));
                separators.add(new Pair<>(d, separator));
            }
        }
        result.add(new Pair<>(separators, edge));
    }
    return result;
}

