    for (int i = 0; i < TAG_TYPE_BITS; i++) {
        int b = in.read();
        if (b == -1) {
            return 0;
        }
        tag |= (b & 0x7F) << (7 * i);
        if ((b & 0x80) == 0) {
            return tag;
        }
    }
    throw new IOException("Too many bits in tag");
}

