public static int computeUTF8Size(final CharSequence str,final int index,final int len){
int size = 0, i = index;
    while (size < len && i < str.length()) {
        char ch = str.charAt(i);
        if (ch <= 0x7F) {
            size += 1;
        } else if (ch <= 0x7FF) {
            size += 2;
        } else if (Character.isHighSurrogate(ch)) {
            size += 4;
            i++;
        } else {
            size += 3;
        }
        i++;
    }
    return size;
}

