private static boolean endsWith(final String str,final String suffix,final boolean ignoreCase){
if(str == null || suffix == null){
        return (str == null && suffix == null);
    }
    if(suffix.length() > str.length()){
        return false;
    }
    int strOffset = str.length() - suffix.length();
    int suffixOffset = 0;
    if(ignoreCase){
        for(; strOffset < str.length() && suffixOffset < suffix.length(); ++strOffset, ++suffixOffset){
            if(!Character.toUpperCase(str.charAt(strOffset)).equals(Character.toUpperCase(suffix.charAt(suffixOffset)))){
                return false;
            }
        }
    }else{
        for(; strOffset < str.length() && suffixOffset < suffix.length(); ++strOffset, ++suffixOffset){
            if(str.charAt(strOffset) != suffix.charAt(suffixOffset)){
                return false;
            }
        }
    }
    return true;
}

