private List<Pair<List<Pair<Integer,Integer>>,E>> computeGlobalSeparatorList(){
List<Pair<List<Pair<Integer,Integer>>,E>> globalSeparatorList = new ArrayList<>();
    for(E edge : graph.edgeSet()){
        List<Pair<Integer,Integer>> separatorList = new ArrayList<>();
        for(E neighbor : graph.edgesOf(graph.getEdgeSource(edge))){
            if(!neighbor.equals(edge)){
                Pair<Integer,Integer> separator = new Pair<>(graph.getEdgeSource(neighbor),graph.getEdgeTarget(neighbor));
                separatorList.add(separator);
            }
        }
        Pair<List<Pair<Integer,Integer>>,E> pair = new Pair<>(separatorList,edge);
        globalSeparatorList.add(pair);
    }
    return globalSeparatorList;
}

