private void pop(final String descriptor){
switch (descriptor.charAt(0)) {
        case 'B':
            pushInt(popInt());
            break;
        case 'C':
            pushInt(popInt());
            break;
        case 'D':
            pushDouble(popDouble());
            break;
        case 'F':
            pushFloat(popFloat());
            break;
        case 'I':
            pushInt(popInt());
            break;
        case 'J':
            pushLong(popLong());
            break;
        case 'S':
            pushInt(popInt());
            break;
        case 'Z':
            pushInt(popInt());
            break;
        case '[':
            pushRef(popRef());
            break;
        default:
            throw new RuntimeException("Invalid descriptor: " + descriptor);
    }
}

