private boolean unlink(ListNodeImpl<E> node){
if(node == null){
    return false;
  }
  ListNodeImpl<E> prev = node.getPrev();
  ListNodeImpl<E> next = node.getNext();
  if(prev == null || next == null){
    return false;
  }
  prev.setNext(next);
  next.setPrev(prev);
  node.setPrev(null);
  node.setNext(null);
  return true;
}

