public final MatchResult match(CharSequence uri){
if (pattern == null) {
    throw new IllegalStateException();
  }
  Matcher matcher=pattern.matcher(uri);
  if (matcher.matches()) {
    if (groupCount == 1) {
      return new MatchResult(true,matcher.group(1),null);
    }
 else {
      Map<String,String> groups=new HashMap<>();
      for (int i=1; i <= groupCount; i++) {
        groups.put(groupNames[i - 1],matcher.group(i));
      }
      return new MatchResult(true,null,groups);
    }
  }
  return null;
}

