  byte[] newBytes=new byte[byteCount + byteLength];
  System.arraycopy(bytes,0,newBytes,0,byteCount);
  System.arraycopy(byteArrayValue,byteOffset,newBytes,byteCount,byteLength);
  bytes=newBytes;
  byteCount+=byteLength;
  return this;
}

