public static Class<?>[] resolveArguments(Type genericType,Class<?> targetType){
if (!genericType.isAssignableFrom(targetType)) {
    return null;
  }
  TypeVariable<?>[] typeParameters=genericType.getTypeParameters();
  if (typeParameters.length == 0) {
    return null;
  }
  TypeVariable<?>[] targetTypeParameters=targetType.getTypeParameters();
  if (targetTypeParameters.length != typeParameters.length) {
    return null;
  }
  Class<?>[] arguments=new Class<?>[typeParameters.length];
  for (int i=0; i < typeParameters.length; i++) {
    TypeVariable<?> typeParameter=typeParameters[i];
    TypeVariable<?> targetTypeParameter=targetTypeParameters[i];
    Type type=targetTypeParameter.getBounds()[0];
    if (type instanceof Class<?>) {
      arguments[i]=(Class<?>)type;
    }
 else {
      arguments[i]=resolveTypeVariable(type,targetType);
    }
  }
  return arguments;
}

