protected void append(LoggingEvent event){
if(layout == null){
        throw new NullPointerException("No layout set for the appender named [" + name + "].");
    }
    String s = layout.format(event);
    if(s != null){
        if(layout.ignoresThrowable() && event.getThrowableInformation() != null){
            s = s + "\n" + event.getThrowableInformation().getThrowableStrRep();
        }
        try{
