public static List<ThreadSnapshot> parseFromFileWithTimeRange(File file,List<ProfileAnalyzeTimeRange> timeRanges) throws IOException {
List<ThreadSnapshot> threadSnapshots = new ArrayList<ThreadSnapshot>();
    BufferedReader reader = new BufferedReader(new FileReader(file));
    String line = null;
    while ((line = reader.readLine()) != null) {
        if (line.startsWith(THREAD_SNAPSHOT_PREFIX)) {
            ThreadSnapshot threadSnapshot = parseFromLine(line);
            if (threadSnapshot != null) {
                if (timeRanges == null || timeRanges.isEmpty()) {
                    threadSnapshots.add(threadSnapshot);
                } else {
                    for (ProfileAnalyzeTimeRange timeRange : timeRanges) {
                        if (timeRange.isInRange(threadSnapshot.getTime())) {
                            threadSnapshots.add(threadSnapshot);
                            break;
                        }
                    }
                }
            }
        }
    }
    reader.close();
    return threadSnapshots;
}

