public long readRawVarint64() throws IOException {
long result = 0;
  for (int shift = 0; shift < 64; shift += 7) {
    final byte b = readRawByte();
    result |= (long)(b & 0x7F) << shift;
    if ((b & 0x80) == 0) {
      return result;
    }
  }
  // If we leave shift >= 64, the only possible value is 0x80, so shift == 64 and we will return 0x80 << 64 == Long.MIN_VALUE.
