private static int decodeOctets(int i,ByteBuffer bb,StringBuilder sb){
int start=i;
    int c=bb.get(i);
    if(c<0){
        int extra=c>>3;
        int len=1<<extra;
        int end=i+len;
        if(end>bb.limit()){
            throw new IllegalArgumentException("Malformed UTF-8");
        }
        int val=c&(0xFF>>extra);
        while(i<end){
            c=bb.get(i);
            if((c&0xC0)!=0x80){
                throw new IllegalArgumentException("Malformed UTF-8");
            }
            val<<=6;
            val|=(c&0x3F);
            i++;
        }
        i=end;
        c=val;
    }
    if(c<=0xFFFF){
        sb.append((char)c);
    }else{
        c-=0x10000;
        sb.append((char)((c>>10)|0xD800));
        sb.append((char)((c&0x3FF)|0xDC00));
    }
    return i;
}

