public List<SequenceRange> buildSequenceRanges(){
List<SequenceRange> sequenceRanges = new ArrayList<>();
    long minSequence = getMinSequence();
    long maxSequence = getMaxSequence();
    long sequenceRangeBatchSize = getSequenceRangeBatchSize();
    long sequenceRange = minSequence;
    while(sequenceRange <= maxSequence){
        long upperBound = sequenceRange + sequenceRangeBatchSize - 1;
        if(upperBound > maxSequence){
            upperBound = maxSequence;
        }
        sequenceRanges.add(new SequenceRange(sequenceRange,upperBound));
        sequenceRange = upperBound + 1;
    }
    return sequenceRanges;
}

