private static int decodeOctets(int i,ByteBuffer bb,StringBuilder sb){
int c=bb.get(i)&0xff;
    if(c<0x80){
        sb.append((char)c);
        return i+1;
    }
    if(c<0xc0){
        throw new IllegalArgumentException("Invalid UTF-8 encoding");
    }
    int n=utf8TrailingBytes[c&0x3f];
    if(n==-1||i+n>=bb.limit()){
        throw new IllegalArgumentException("Invalid UTF-8 encoding");
    }
    int v=c&(0x3f>>n);
    for(int j=0;j<n;j++){
        c=bb.get(i+j+1)&0xff;
        if((c&0xc0)!=0x80){
            throw new IllegalArgumentException("Invalid UTF-8 encoding");
        }
        v=v<<6|(c&0x3f);
    }
    if(v>Character.MAX_CODE_POINT){
        throw new IllegalArgumentException("Invalid UTF-8 encoding");
    }
    sb.append((char)v);
    return i+n+1;
}

