@Override public void write(final byte b[],final int off,final int len) throws IOException {
if (b == null) {
        throw new NullPointerException();
    } else if ((off < 0) || (off > b.length) || (len < 0) ||
               ((off + len) > b.length) || ((off + len) < 0)) {
        throw new IndexOutOfBoundsException();
    } else if (len == 0) {
        return;
    }
    if (this.writeBuffer == null) {
        this.writeBuffer = new byte[this.bufferSize];
    }
    int left = len;
    int offset = off;
    while (left > 0) {
        final int leftover = this.writeBuffer.length - this.writeBufferPos;
        final int writeThisTime = (left > leftover) ? leftover : left;
        System.arraycopy(b, offset, this.writeBuffer, this.writeBufferPos, writeThisTime);
        this.writeBufferPos += writeThisTime;
        offset += writeThisTime;
        left -= writeThisTime;
        if (this.writeBufferPos == this.writeBuffer.length) {
            flush();
        }
    }
}

