public static int computeUTF8Size(final CharSequence str,final int index,final int len){
int size = 0;
    for(int i = index;i<index+len;i++){
        final char ch = str.charAt(i);
        if(ch<0x80){
            size++;
        }else if(ch<0x800){
            size+=2;
        }else if(Character.isSurrogate(ch)){
            size+=4;
            i++;
        }else{
            size+=3;
        }
    }
    return size;
}

