public static List<PathSegmentImpl> decodePath(URI u,boolean decode){
String rawPath = u.getRawPath();
        if(rawPath==null){
            return Collections.emptyList();
        }
        List<PathSegmentImpl> segments = new ArrayList<>();
        int start = 0;
        int end = rawPath.indexOf('/',start);
        while(end>=0){
            segments.add(new PathSegmentImpl(rawPath.substring(start,end),decode));
            start = end+1;
            end = rawPath.indexOf('/',start);
        }
        segments.add(new PathSegmentImpl(rawPath.substring(start),decode));
        return segments;
    }

