private Class findClass(final String className) throws ClassNotFoundException {
// First, try to find the class in the cache.
Class cachedClass = (Class) classCache.get(className);
if (cachedClass != null) {
return cachedClass;
}
// Next, try to find the class in the classpath.
try {
cachedClass = Class.forName(className);
} catch (ClassNotFoundException e) {
// If the class is not found in the classpath, try to find it in the
// parent classloader.
if (parent != null) {
cachedClass = parent.findClass(className);
}
}
// Finally, cache the class.
if (cachedClass != null) {
classCache.put(className, cachedClass);
}
return cachedClass;
}

