    long duration = end - start;
    if(duration > FETCH_DATA_DURATION){
        long split = duration / FETCH_DATA_DURATION;
        for(int i = 0;i < split;i++){
            long startTime = start + i * FETCH_DATA_DURATION;
            long endTime = startTime + FETCH_DATA_DURATION;
            timeRanges.add(new TimeRange(startTime,endTime));
        }
        if(endTime < end){
            timeRanges.add(new TimeRange(endTime,end));
        }
    }else{
        timeRanges.add(new TimeRange(start,end));
    }
    return timeRanges;
}

