static long compressTimeBucket(long timeBucket,int dayStep){
if(dayStep == 1){
        return timeBucket;
    }
    long timeBucketDay = timeBucket / 100;
    long timeBucketRemain = timeBucket % 100;
    long timeBucketRemainCompress = timeBucketRemain - timeBucketRemain % dayStep;
    if(timeBucketRemainCompress < 0){
        timeBucketRemainCompress = 0;
    }
    return timeBucketDay * 100 + timeBucketRemainCompress;
}

