private boolean unlink(ListNodeImpl<E> node){
if(node.prev==null&&node.next==null){
        //node is the only node in the list
        this.head=null;
        this.tail=null;
        this.size=0;
        return true;
    }
    if(node.prev==null){
        //node is the head node
        this.head=node.next;
        this.head.prev=null;
        this.size--;
        return true;
    }
    if(node.next==null){
        //node is the tail node
        this.tail=node.prev;
        this.tail.next=null;
        this.size--;
        return true;
    }
    //node is the middle node
    node.prev.next=node.next;
    node.next.prev=node.prev;
    this.size--;
    return true;
}

