public static String unescapeJava(String str) throws Exception {
    if (str == null) {
        return null;
    }
    StringBuilder sb = new StringBuilder(str.length());
    for (int i = 0; i < str.length(); i++) {
        char c = str.charAt(i);
        if (c == '\\') {
            if (i + 1 < str.length()) {
                char nextChar = str.charAt(i + 1);
                switch (nextChar) {
                    case '\"':
                        sb.append('\"');
                        i++;
                        break;
                    case '\\':
                        sb.append('\\');
                        i++;
                        break;
                    case 'n':
                        sb.append('\n');
                        i++;
                        break;
                    case 'r':
                        sb.append('\r');
                        i++;
                        break;
                    case 't':
                        sb.append('\t');
                        i++;
                        break;
                    case 'b':
                        sb.append('\b');
                        i++;
                        break;
                    case 'f':
                        sb.append('\f');
                        i++;
                        break;
                    case 'u':
                        if (i + 5 < str.length()) {
                            String unicode = str.substring(i + 2, i + 6);
                            char unicodeChar = (char) Integer.parseInt(unicode, 16);
                            sb.append(unicodeChar);
                            i += 5;
                        } else {
                            throw new Exception("Invalid unicode escape sequence in input");
                        }
                        break;
                    default:
                        sb.append(nextChar);
                        i++;
                        break;
                }
            } else {
                throw new Exception("Invalid escape sequence in input");
            }
        } else {
            sb.append(c);
        }
    }
    return sb.toString();
}

