final String readUtf(final int constantPoolEntryIndex, final char[] charBuffer) {
    int length = ((classFileBuffer[constantPoolEntryIndex] & 0xFF) << 8) | (classFileBuffer[constantPoolEntryIndex + 1] & 0xFF);
    if (charBuffer == null || charBuffer.length < length) {
        charBuffer = new char[length];
    }
    int charBufferIndex = 0;
    int byteBufferIndex = constantPoolEntryIndex + 2;
    int bytesToRead = length;
    while (bytesToRead-- > 0) {
        int byte1 = classFileBuffer[byteBufferIndex++] & 0xFF;
        if ((byte1 & 0x80) == 0) {
            charBuffer[charBufferIndex++] = (char) byte1;
        } else if ((byte1 & 0xE0) == 0xC0) {
            int byte2 = classFileBuffer[byteBufferIndex++] & 0xFF;
            charBuffer[charBufferIndex++] = (char) (((byte1 & 0x1F) << 6) | (byte2 & 0x3F));
        } else {
            int byte2 = classFileBuffer[byteBufferIndex++] & 0xFF;
            int byte3 = classFileBuffer[byteBufferIndex++] & 0xFF;
            charBuffer[charBufferIndex++] = (char) (((byte1 & 0x0F) << 12) | ((byte2 & 0x3F) << 6) | (byte3 & 0x3F));
        }
    }
    return new String(charBuffer, 0, charBufferIndex);
}

