public List<SequenceRange> buildSequenceRange(int minSequence, int maxSequence, int SEQUENCE_RANGE_BATCH_SIZE) {
    List<SequenceRange> sequenceRanges = new ArrayList<>();
    int start = minSequence;
    while (start <= maxSequence) {
        int end = start + SEQUENCE_RANGE_BATCH_SIZE - 1;
        if (end > maxSequence) {
            end = maxSequence;
        }
        sequenceRanges.add(new SequenceRange(start, end));
        start = end + 1;
    }
    return sequenceRanges;
}

