    int totalBytesWritten = 0;
    while (node != null) {
        int length = node.writeIndex - node.readIndex;
        out.write(node.buffer, node.readIndex, length);
        totalBytesWritten += length;
        node = node.next;
    }
    return totalBytesWritten;
}

