private static int decodeOctets(int i, ByteBuffer bb, StringBuilder sb) {
    while (i < bb.limit()) {
        byte b = bb.get(i);
        if ((b & 0x80) == 0) { // 1-byte, 0xxxxxxx
            sb.append((char) b);
            i++;
        } else if ((b & 0xE0) == 0xC0) { // 2-byte, 110xxxxx 10xxxxxx
            if (i + 1 < bb.limit()) {
                int c2 = bb.get(i + 1);
                if ((c2 & 0xC0) == 0x80) {
                    char c = (char) (((b & 0x1F) << 6) | (c2 & 0x3F));
                    sb.append(c);
                    i += 2;
                } else {
                    break;
                }
            } else {
                break;
            }
        } else if ((b & 0xF0) == 0xE0) { // 3-byte, 1110xxxx 10xxxxxx 10xxxxxx
            if (i + 2 < bb.limit()) {
                int c2 = bb.get(i + 1);
                int c3 = bb.get(i + 2);
                if ((c2 & 0xC0) == 0x80 && (c3 & 0xC0) == 0x80) {
                    char c = (char) (((b & 0x0F) << 12) | ((c2 & 0x3F) << 6) | (c3 & 0x3F));
                    sb.append(c);
                    i += 3;
                } else {
                    break;
                }
            } else {
                break;
            }
        } else if ((b & 0xF8) == 0xF0) { // 4-byte, 11110xxx 10xxxxxx 10xxxxxx 10xxxxxx
            if (i + 3 < bb.limit()) {
                int c2 = bb.get(i + 1);
                int c3 = bb.get(i + 2);
                int c4 = bb.get(i + 3);
                if ((c2 & 0xC0) == 0x80 && (c3 & 0xC0) == 0x80 && (c4 & 0xC0) == 0x80) {
                    int codePoint = ((b & 0x07) << 18) | ((c2 & 0x3F) << 12) | ((c3 & 0x3F) << 6) | (c4 & 0x3F);
                    sb.append(Character.toChars(codePoint));
                    i += 4;
                } else {
                    break;
                }
            } else {
                break;
            }
        } else {
            break;
        }
    }
    return i;
}

