public static String unescapeJava(String str) throws Exception {
    if (str == null) {
        return null;
    }
    StringBuilder builder = new StringBuilder();
    char[] charArray = str.toCharArray();
    for (int i = 0; i < charArray.length; i++) {
        char ch = charArray[i];
        if (ch == '\\') {
            if (i == charArray.length - 1) {
                throw new IllegalArgumentException("Invalid escape character at the end of string");
            }
            char nextChar = charArray[++i];
            switch (nextChar) {
                case 'b':
                    builder.append('\b');
                    break;
                case 't':
                    builder.append('\t');
                    break;
                case 'n':
                    builder.append('\n');
                    break;
                case 'f':
                    builder.append('\f');
                    break;
                case 'r':
                    builder.append('\r');
                    break;
                case '"':
                    builder.append('"');
                    break;
                case '\'':
                    builder.append('\'');
                    break;
                case '\\':
                    builder.append('\\');
                    break;
                case 'u':
                    if (i + 4 >= charArray.length) {
                        throw new IllegalArgumentException("Invalid unicode escape sequence at index " + i);
                    }
                    String hex = new String(charArray, i + 1, 4);
                    try {
                        int code = Integer.parseInt(hex, 16);
                        builder.append((char) code);
                        i += 4;
                    } catch (NumberFormatException e) {
                        throw new IllegalArgumentException("Invalid unicode escape sequence at index " + i + ": " + hex);
                    }
                    break;
                default:
                    throw new IllegalArgumentException("Unknown escape sequence: \\" + nextChar);
            }
        } else {
            builder.append(ch);
        }
    }
    return builder.toString();
}

