protected GraphPath<V,E> edgeSetToTour(Set<E> tour, Graph<V,E> graph) {
    if (tour == null || graph == null) {
        throw new IllegalArgumentException("Tour and graph cannot be null");
    }

    List<E> edges = new ArrayList<>(tour);
    List<V> vertices = new ArrayList<>();
    V startVertex = null;

    for (E edge : edges) {
        V source = graph.getEdgeSource(edge);
        V target = graph.getEdgeTarget(edge);

        if (startVertex == null) {
            startVertex = source;
            vertices.add(source);
        }
        vertices.add(target);
    }

    double weight = edges.stream().mapToDouble(graph::getEdgeWeight).sum();
    return new GraphWalk<>(graph, startVertex, vertices.get(vertices.size() - 1), vertices, edges, weight);
}

